import logo from './logo.svg';
import './App.css';
import { Component } from 'react';
import "./sass/app.scss";

class App extends Component {
  render() {
    return <div className="app-container">
      <div className="main-container">
        <div className="top">
          TOP
          <div className="bottom">
            BOTTOM
          </div>
        </div>
      </div>
    </div>
  }
}

export default App;
